import React from 'react'
import { Select,Space } from "antd";

function Dropdown2() {
  return (
    <div className='App'>
        <Space direction="horizontal" size={12}>
            <Select placeholder="Salary from"/>
            <Select placeholder="Salary to"/>

        </Space>
      
    </div>
  )
}

export default Dropdown2
